import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { getContestProblems } from '../services/api';

const SolveContest = () => {
  const { contestId } = useParams();
  const [problems, setProblems] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    getContestProblems(contestId)
      .then((response) => {
        if (response.data.contest_problems) {
          setProblems(response.data.contest_problems);
        }
      })
      .catch((err) => setError('Failed to load contest problems.'));
  }, [contestId]);

  return (
    <div className="solve-contest-container">
      <h2>Contest Problems</h2>
      {error ? (
        <p className="error-message">{error}</p>
      ) : (
        <div className="problems-list">
          {problems.length === 0 ? (
            <p>No problems found for this contest.</p>
          ) : (
            problems.map((problem) => (
              <div key={problem.id} className="problem-card">
                <h3>{problem.title}</h3>
                <p>{problem.description}</p>
                <p><strong>Difficulty:</strong> {problem.difficulty}</p>
                <p><strong>Example:</strong> {problem.example}</p>
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
};

export default SolveContest;
